def merge_the_tools(string, k):
    str_len = len(string)
    # k = int(str_len/k)
    # print(k)
    for i in range(0, str_len, k):
        non_uniq_str = string[i:i + k]
        uniq_str = []
        for i in non_uniq_str:
            if i not in uniq_str:
                uniq_str.append(i)
        uniq_str = "".join(uniq_str)
        print(uniq_str)


if __name__ == '__main__':
    string = ''
    k = 3452
    merge_the_tools(string, k)
